import "./App.css";
import { Box, Button, Grid, makeStyles } from "@material-ui/core";
import Header from "./Header";
import { createMuiTheme } from "@material-ui/core/styles";
import MenuIcon from "@material-ui/icons/Menu";
import React from "react";

const styles = {
  button: {},
  box: { background: "#9ca9b3" },
};

const useStyles = makeStyles((theme) => ({
  container: {
    display: "flex",
  },
  item: {
    border: "1px solid blue",
  },
  itemFlexGrow: {
    flexGrow: 1,
    border: "1px solid red",
  },
}));

const theme = createMuiTheme({
  palette: {
    primary: {
      light: "#757ce8",
      main: "#3f50b5",
      dark: "#002884",
      contrastText: "#fff",
    },
    secondary: {
      light: "#ff7961",
      main: "#f44336",
      dark: "#ba000d",
      contrastText: "#000",
    },
  },
});

function App() {
  return (
    <div className="App">
      <Grid
        container
        direction="column"
        justify="space-between"
        alignItems="center"
      >
        <Grid container item xs={12} spacing={3}>
          {" "}
          <Header />
        </Grid>
        <Grid container item xs={12} spacing={3}>
          <p>sdfgs</p>
        </Grid>
      </Grid>
    </div>
  );
}

export default App;
